// SPDX-License-Indentifier: MIT
pragma solidity >=0.4.22 <0.9.0;

abstract contract Context {
    function _msgSender() internal view virtual returns (address) {
        return msg.sender;
    }

    function _msgData() internal view virtual returns (bytes calldata) {
        return msg.data;
    }
}

library Address {
    function isContract(address account) internal view returns (bool) {
        // This method relies on extcodesize/address.code.length, which returns 0
        // for contracts in construction, since the code is only stored at the end
        // of the constructor execution.

        return account.code.length > 0;
    }

    function sendValue(address payable recipient, uint256 amount) internal {
        require(
            address(this).balance >= amount,
            "Address: insufficient balance"
        );

        (bool success, ) = recipient.call{value: amount}("");
        require(
            success,
            "Address: unable to send value, recipient may have reverted"
        );
    }

    function functionCall(address target, bytes memory data)
        internal
        returns (bytes memory)
    {
        return functionCall(target, data, "Address: low-level call failed");
    }

    function functionCall(
        address target,
        bytes memory data,
        string memory errorMessage
    ) internal returns (bytes memory) {
        return functionCallWithValue(target, data, 0, errorMessage);
    }

    function functionCallWithValue(
        address target,
        bytes memory data,
        uint256 value
    ) internal returns (bytes memory) {
        return
            functionCallWithValue(
                target,
                data,
                value,
                "Address: low-level call with value failed"
            );
    }

    function functionCallWithValue(
        address target,
        bytes memory data,
        uint256 value,
        string memory errorMessage
    ) internal returns (bytes memory) {
        require(
            address(this).balance >= value,
            "Address: insufficient balance for call"
        );
        require(isContract(target), "Address: call to non-contract");

        (bool success, bytes memory returndata) = target.call{value: value}(
            data
        );
        return verifyCallResult(success, returndata, errorMessage);
    }

    function functionStaticCall(address target, bytes memory data)
        internal
        view
        returns (bytes memory)
    {
        return
            functionStaticCall(
                target,
                data,
                "Address: low-level static call failed"
            );
    }

    function functionStaticCall(
        address target,
        bytes memory data,
        string memory errorMessage
    ) internal view returns (bytes memory) {
        require(isContract(target), "Address: static call to non-contract");

        (bool success, bytes memory returndata) = target.staticcall(data);
        return verifyCallResult(success, returndata, errorMessage);
    }

    function functionDelegateCall(address target, bytes memory data)
        internal
        returns (bytes memory)
    {
        return
            functionDelegateCall(
                target,
                data,
                "Address: low-level delegate call failed"
            );
    }

    function functionDelegateCall(
        address target,
        bytes memory data,
        string memory errorMessage
    ) internal returns (bytes memory) {
        require(isContract(target), "Address: delegate call to non-contract");

        (bool success, bytes memory returndata) = target.delegatecall(data);
        return verifyCallResult(success, returndata, errorMessage);
    }

    function verifyCallResult(
        bool success,
        bytes memory returndata,
        string memory errorMessage
    ) internal pure returns (bytes memory) {
        if (success) {
            return returndata;
        } else {
            // Look for revert reason and bubble it up if present
            if (returndata.length > 0) {
                // The easiest way to bubble the revert reason is using memory via assembly

                assembly {
                    let returndata_size := mload(returndata)
                    revert(add(32, returndata), returndata_size)
                }
            } else {
                revert(errorMessage);
            }
        }
    }
}

abstract contract Ownable is Context {
    address private _owner;

    event OwnershipTransferred(
        address indexed previousOwner,
        address indexed newOwner
    );

    /**
     * @dev Initializes the contract setting the deployer as the initial owner.
     */
    constructor() {
        _transferOwnership(_msgSender());
    }

    /**
     * @dev Returns the address of the current owner.
     */
    function owner() public view virtual returns (address) {
        return _owner;
    }

    /**
     * @dev Throws if called by any account other than the owner.
     */
    modifier onlyOwner() {
        require(owner() == _msgSender(), "Ownable: caller is not the owner");
        _;
    }

    /**
     * @dev Leaves the contract without owner. It will not be possible to call
     * `onlyOwner` functions anymore. Can only be called by the current owner.
     *
     * NOTE: Renouncing ownership will leave the contract without an owner,
     * thereby removing any functionality that is only available to the owner.
     */
    function renounceOwnership() public virtual onlyOwner {
        _transferOwnership(address(0));
    }

    /**
     * @dev Transfers ownership of the contract to a new account (`newOwner`).
     * Can only be called by the current owner.
     */
    function transferOwnership(address newOwner) public virtual onlyOwner {
        require(
            newOwner != address(0),
            "Ownable: new owner is the zero address"
        );
        _transferOwnership(newOwner);
    }

    /**
     * @dev Transfers ownership of the contract to a new account (`newOwner`).
     * Internal function without access restriction.
     */
    function _transferOwnership(address newOwner) internal virtual {
        address oldOwner = _owner;
        _owner = newOwner;
        emit OwnershipTransferred(oldOwner, newOwner);
    }
}

interface ERC721TokenReceiver {
    function onERC721Received(
        address _operator,
        address _from,
        uint256 _tokenId,
        bytes calldata _data
    ) external returns (bytes4);
}

interface IERC721 {
    event Transfer(
        address indexed _from,
        address indexed _to,
        uint256 indexed _tokenId
    );

    event Approval(
        address indexed _owner,
        address indexed _approved,
        uint256 indexed _tokenId
    );

    event ApprovalForAll(
        address indexed _owner,
        address indexed _operator,
        bool _approved
    );

    function balanceOf(address _owner) external view returns (uint256);

    function ownerOf(uint256 _tokenId) external view returns (address);

    function transfer(address recipient, uint256 tokenId)
        external
        returns (bool);

    function safeTransferFrom(
        address _from,
        address _to,
        uint256 _tokenId,
        bytes calldata data
    ) external payable;

    function safeTransferFrom(
        address _from,
        address _to,
        uint256 _tokenId
    ) external payable;

    function transferFrom(
        address _from,
        address _to,
        uint256 _tokenId
    ) external payable;

    // function approve(address _approved, uint256 _tokenId) external payable;

    // function setApprovalForAll(address _operator, bool _approved) external;

    // function getApproved(uint256 _tokenId) external view returns (address);

    // function isApprovedForAll(address _owner, address _operator)
    //     external
    //     view
    //     returns (bool);
}

contract ERC721 is IERC721, Context, Ownable {
    using Address for address;

    mapping(address => uint256) private _ownerToTokenCount;
    mapping(uint256 => address) private _idToOwner;
    mapping(uint256 => address) private _tokenURIs;

    bytes4 internal constant MAGIC_ON_ERC721_RECEIVE = 0x150b7a02;

    string private _name;
    string private _symbol;
    string private _tokenURIBase;

    constructor(
        string memory name,
        string memory symbol,
        string memory tokenURIBase
    ) {
        _name = name;
        _symbol = symbol;
        _tokenURIBase = tokenURIBase;
    }

    function tokenURI(uint256 _tokenId) external view returns (string memory) {
        return string(abi.encodePacked(_tokenURIBase, _tokenId));
    }

    function _mint(address _owner, uint256 _tokenId) internal {
        require(_idToOwner[_tokenId] == address(0), "this token already exist");
        _idToOwner[_tokenId] = _owner;
        _ownerToTokenCount[_owner] += 1;
    }

    function transfer(address recipient, uint256 tokenId)
        public
        virtual
        override
        returns (bool)
    {
        _transfer(_msgSender(), recipient, tokenId);
        return true;
    }

    function balanceOf(address _owner) external view returns (uint256) {
        return _ownerToTokenCount[_owner];
    }

    function ownerOf(uint256 _tokenId) external view returns (address) {
        return _idToOwner[_tokenId];
    }

    function transferFrom(
        address _from,
        address _to,
        uint256 _tokenId
    ) external payable {
        require(
            msg.sender == _from,
            "ERC721: Can't Authorized the transfer token"
        );
        require(
            _from == _idToOwner[_tokenId],
            "ERC721: Can't Authorized the transfer token"
        );
        _ownerToTokenCount[_from] -= 1;
        _ownerToTokenCount[_to] += 1;
        emit Transfer(_from, _to, _tokenId);
    }

    function safeTransferFrom(
        address _from,
        address _to,
        uint256 _tokenId,
        bytes calldata data
    ) external payable {
        _safeTransferFrom(_from, _to, _tokenId, data);
    }

    function safeTransferFrom(
        address _from,
        address _to,
        uint256 _tokenId
    ) external payable {
        _safeTransferFrom(_from, _to, _tokenId, "");
    }

    function _safeTransferFrom(
        address _from,
        address _to,
        uint256 _tokenId,
        bytes memory _data
    ) internal {
        require(
            msg.sender == _from,
            "ERC721: Can't Authorized the transfer token"
        );
        require(
            _from == _idToOwner[_tokenId],
            "ERC721: Can't Authorized the transfer token"
        );
        _ownerToTokenCount[_from] -= 1;
        _ownerToTokenCount[_to] += 1;
        emit Transfer(_from, _to, _tokenId);
        if (_to.isContract()) {
            bytes4 retval = ERC721TokenReceiver(_to).onERC721Received(
                msg.sender,
                _from,
                _tokenId,
                _data
            );
            // require(retval = MAGIC_ON_ERC721_RECEIVE, "Can't transfer token");
            // _transfer(_from,_to)
        }
    }

    function onERC721Received(
        address _operator,
        address _from,
        uint256 _tokenId,
        bytes calldata _data
    ) external returns (bytes4) {}

    function _transfer(
        address sender,
        address recipient,
        uint256 tokenId
    ) internal virtual {
        require(sender != address(0), "ERC721: transfer from the zero address");
        require(
            recipient != address(0),
            "ERC721: transfer to the zero address"
        );

        _beforeTokenTransfer(sender, recipient, tokenId);

        _idToOwner[tokenId] = recipient;
        _ownerToTokenCount[recipient] += 1;
        emit Transfer(sender, recipient, tokenId);
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual {
        require(
            _idToOwner[tokenId] == from,
            "ERC721: transfer not owner token"
        );
    }
}

contract SQFItem is ERC721("SQFITEM", "SQFI", "test.com") {
    // function tokenURI(uint256 _tokenId) external view returns (string memory) {
    //     return string(abi.encodePacked( tokenURIBase, tokenId));
    // }

    struct Weapon {
        string tokenURI;
    }

    uint256 public nextId = 1;
    address public admin;

    mapping(uint256 => Weapon) public weaponDetail;
    mapping(uint256 => address) private weapons;

    function mint(string memory _tokenURI) public {
        Weapon memory newWeapon = Weapon(_tokenURI);
        weaponDetail[nextId] = newWeapon;
        _mint(msg.sender, nextId);
        nextId++;
    }
}

